import React from 'react';
import { View, StatusBar } from 'react-native';
import { AntDesign } from '@expo/vector-icons';

// Components
import CustomText from '../CustomText';

import { colors } from '../../styles';

function CartContainer() {
	return (
		<View style={{ justifyContent: 'center', alignItems: 'center', backgroundColor: 'white', flex: 1 }}>
			<StatusBar backgroundColor={colors.mainColor} />

			<View style={{ alignItems: 'center', justifyContent: 'center' }}>
				<View
					style={{
						backgroundColor: '#f4f4f4',
						borderRadius: 120,
						width: 90,
						height: 90,
						alignItems: 'center',
						justifyContent: 'center'
					}}
				>
					<AntDesign name="shoppingcart" size={58} color={'grey'} />
				</View>

				<CustomText customStyle={{ textAlign: 'center', marginTop: 10 }}>سبد خرید شما خالی است .</CustomText>
			</View>
		</View>
	);
}

export default CartContainer;
